import React from 'react'
import {StyledListItem, StyledList} from "./TodoList.styled";

const state = {
    done: false
};

const TodoList = ({data}) => {
    return (
        <div>
            <StyledList>
                {data.map(({label, id}) => {
                    return (
                            <StyledListItem done={state.done} key = {id}>
                                {label}
                            </StyledListItem>
                        )
                })}

            </StyledList>
        </div>
    )
};

export default TodoList;
